import React from 'react';
import Button from './Button';

const list = ["All", "Gaming", "Songs", "Live", "Cricket", "Cooking"];

const ButtonList = () => {
  return (
    <div className='flex'>
      {list.map((ListItem, index) => (
        <Button name={ListItem} key={index}></Button>
      ))}
    </div>
  );
}

export default ButtonList;
